class EqSimplification(threading.Thread):

    def __init__(self, number, Equation, λ_1, λ_2, λ_3, λ_4):
        threading.Thread.__init__(self)
        self.number = number
        self.eq = Equation
        self.λ_1 = λ_1
        self.λ_2 = λ_2
        self.λ_3 = λ_3
        self.λ_4 = λ_4

    def run(self):
        self.eq = self.eq.subs(λ1, self.λ_1)
        self.eq = self.eq.subs(λ2, self.λ_2)
        self.eq = self.eq.subs(λ3, self.λ_3)
        self.eq = self.eq.subs(λ4, self.λ_4)
        print(self.number, " subs done")
        eq_top, eq_bot = fraction(together(self.eq))
        print("Eq ", self.number, " :", expand_and_collect_term_before_derivatives_and_lambda(eq_top))

